import {listScopes,listScopesRelation} from "@/api/ANew/index";
export async function getScopes() {
    let result = await listScopes();
    try{
        if(result.code == 200) {
            return result.data;
        } else {
            throw '经营范围scopes获取失败'
        }
    } catch(e) {
        console.warn(e)
    }
}

export async function getScopesRelation() {
    let result = await listScopesRelation();
    try{
        if(result.code == 200) {
            return result.data;
        } else {
            throw '经营范围对应关系scopes获取失败'
        }
    } catch(e) {
        console.warn(e)
    }
}
